019ve summoned the great guardian Mushu to fire up your business!\n\nThe iconic Disney dragon is Mulan\u2019s most-trusted friend, he\u2019s (somewhat) fearless and always good for a laugh. And now this loyal sidekick can be your personal guardian.\n\nThe dragon\u2019s in the details on our new Mushu \u2013 Scentsy Buddy, from his spiky tail and claws to the scales on his back, shiny gold accents and the notch in his ear.\n\nEvery Mushu \u2013 Scentsy Buddy comes with a preselected Scent Pak in the fragrance designed just for him \u2014 Not Your Everyday Dragon: Feed your guardian spirit with sweet papaya nectar, juicy mango and a delicate touch of red ginger flower. This fragrance is also available separately as a Scent Pak or Scentsy Bar.\n\nHere are the options and the Personal Retail Volume (PRV) you\u2019ll earn from every sale:\n\nMushu \u2013 Scentsy Buddy with a Not Your Everyday Dragon \u2013 Scent Pak, $46 (30 PRV)\nNot Your Everyday Dragon \u2013 Scent Pak, $9.50 (7 PRV)\nNot Your Everyday Dragon \u2013 Scentsy Bar, $8.50 (6 PRV)*\nHow to promote\n\nMushu and Not Your Everyday Dragon will be available while supplies last, starting between 9:30 and 10:30 a.m. PT March 16. Be sure to visit the Marketing section of Scentsy Success and Photofy for ready-made promotional images to share on social media. This is a great time to reach out to Mulan fans and grow your customer base, building off the hype of the new movie.\n\nScentsy Club: Always Get My Bar\n\nStarting March 16, Not Your Everyday Dragon \u2013 Scentsy Bars can be added to Scentsy Club subscriptions within 30 days after launch, or as long as the fragrance is available beyond that date.\u2020 *Individual bars can be added to 3-packs or 6-packs of licensed Scentsy Bars. \u2020See the Scentsy Club FAQ for more details.\n\n#disney #mulan #mushu #dragon #love #business #money #scent #scentsy #sahm #wahm"}}]},"shortcode":"B9xqOZOgYtQ","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584321782,"di 5-15/sh0.08/e35/s640x640/90303609_2647656838679757_6446867156474123898_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=g3PStgpWQKoAX_s4-qy\u0026oh=37da2b3229ee3d8db2ee7be162498343\u0026oe=5E9FA65D","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"Photo shared by \u2022Mickey\u2022 on March 15, 2020 tagging @paribean. \u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a1 \u4f4d\u7528\u6237\u3001\u5750\u7740\u548c\u6237\u5916"}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2265777759459229764","edge_media_to_caption":{"edges":[{"node":{"text":"A veces estamos planificando en funci\u00f3n de la falta de tiempo, cosas \" impostergables\", creyendo que si no se hacen en el momento, se acaba el mundo, \"no tenemos tiempo\", creyendo que podemos tener el control sobre todo... la tierra necesitaba desconectarse, descontaminarse, se toma un respiro y para ello obliga a todo el planeta a detenernos, de vuelta a la esencia,  ver nuestra fragilidad y vulnerabilidad y en eso, estamos todos conectados,\n\nEntender  la importancia de las pausas, antes de colapsar definitivamente... este escenario nos enfrenta con la necesidad de replantearnos, empezar a caminar hacia una conciencia ecol\u00f3gica, solidaria y voltear la mirada hacia el otro, s\u00ed \u00e9l est\u00e1 bien, en consecuencia todos lo estamos,  a exigir gobiernos que garanticen condiciones de salubridad \u00f3ptimos, a la #prevenci\u00f3n permanente.\n\nEn #Caracas te encuentras con esta joya arquitect\u00f3nica ( iglesia neog\u00f3tica nuestra se\u00f1ora de Lourdes, construida en 1922 por el arquitecto franc\u00e9s  Eugene-Emmanuel Viollet-le-Duc), en la esquina de San Juan de San Mart\u00edn.  En momentos como los que atraviesa el planeta, fortalecer la fe, esperanza y confianza en Dios, se hace necesario \u2764. #Venezuela #church #iglesia #fe #esperanza #love #esencia #paz #hope #healt  #home #hogar #saludable #instaphotography #cultura #culture #patrimonio #espititual #spirit #introspeccion #instagood #instanice #conciencia #salud #coronav\u00edrus"}}]},"shortcode":"B9xqN4cjEBE","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584321778,"dimensions":{"height":1350,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89598424_926175371150451_8994542613238037402_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=CXRg9PaC1PsAX_Tz2hX\u0026oh=f202257f13635d21e52465161cba16da\u0026oe=5E9EA69A","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"10158413344"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.96.768.768a/s640x640/89598424_926175371150451_8994542613238037402_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=CXRg9PaC1PsAX_Tz2hX\u0026oh=fffa1fec51fe94bc8be93ebf5e0a07c1\u0026oe=5EA0E0DB","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.96.768.768a/s150x150/89598424_926175371150451_8994542613238037402_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=CXRg9PaC1PsAX_Tz2hX\u0026oh=ea31f6170e299cf2584a1e958904e424\u0026oe=5E9CCAD1","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.96.768.768a/s240x240/89598424_926175371150451_8994542613238037402_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=CXRg9PaC1PsAX_Tz2hX\u0026oh=b75105a3a077af3664bb868f4cbd6997\u0026oe=5E9B9B9B","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.96.768.768a/s320x320/89598424_926175371150451_8994542613238037402_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=CXRg9PaC1PsAX_Tz2hX\u0026oh=308ff883c78b45c2b1a1dbc376fabf0f\u0026oe=5EA4CB21","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t5 e praises that went up. And I am so grateful to Holy Spirit for showing up and showing Himself strong in our midst. Thank you S\u0026T. Thank You, Holy Spirit. S\u0026T is a wonderful place to be."}}]},"shortcode":"B9xqNEkpSXQ","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584321772,"dimensions":{"height":750,"width":750},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89750293_225617561917575_6172371698853182646_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=KG1kZaAjFPoAX9Y_j7d\u0026oh=e95afe4ddf25848b38e39684f29d14a3\u0026oe=5EA47B28","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"3603842144"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89750293_225617561917575_6172371698853182646_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=KG1kZaAjFPoAX9Y_j7d\u0026oh=5afb50d53e0b9c354d956e5e037e3aa8\u0026oe=5E9C51CD","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89750293_225617561917575_6172371698853182646_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=KG1kZaAjFPoAX9Y_j7d\u0026oh=a034551625a402a1dad1c97c739c57f6\u0026oe=5EA4176A","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89750293_225617561917575_6172371698853182646_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=KG1kZaAjFPoAX9Y_j7d\u0026oh=1f3e44c3f79323471fbc7d0ed483affa\u0026oe=5E9B2020","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/89750293_225617561917575_6172371698853182646_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=KG1kZaAjFPoAX9Y_j7d\u0026oh=1018836fec075fe14b0928778f0fcdc3\u0026oe=5E9DA09A","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.c
